var requestOptions = {
  method: "PUT",
  redirect: "follow",
};

fetch("http://localhost:3004/update/24/1/2/3/4/5/6/", requestOptions)
  .then((response) => response.text())
  .then((result) => console.log(result))
  .catch((error) => console.log("error", error));
